import React from 'react';
import '../../css/Common/Spinner.css';
import spinnerImg from '../../assets/loading-simp.png';

function Spinner () {
    return (
        <img src={spinnerImg} alt="Loading..." className={"SpinnerImg"} />
    );
}

export default Spinner;
